import React from 'react';
import Table from 'react-bootstrap/Table';

import './Players.css';

const Players = () => {
  const MOCK_PLAYERS = [
    {
      Name: 'Novak Djokovic',
      Country: 'Serbia',
      Age: 33,
      Grand_Slams: 17,
      Ranking: 1,
      Points: 12030,
    },
    {
      Name: 'Rafael Nadal',
      Country: 'Spain',
      Age: 34,
      Grand_Slams: 20,
      Ranking: 2,
      Points: 9850,
    },
    {
      Name: 'Roger Federer',
      Country: 'Switzerland',
      Age: 39,
      Grand_Slams: 20,
      Ranking: 3,
      Points: 6630,
    },
  ];

  return (
    <div>
      <h2>Players works!</h2>
    </div>
  );
};

export default Players;
